          <div className="view__header">
            <h3 className="dash-title">ສ້າງຂໍ້ມູນກ່ຽວກັບສີນຄ້າ</h3>
            <a onClick={() => Router.push("/admin/products")}>
              <span className="ti-angle-left"></span>
              <small>ກັບຄືນ</small>
            </a>
          </div>
        </main>
      </div>
    </>
  );
}

export default ProductInfo;
